-- ----------------------------
-- Table structure for menus
-- ----------------------------
DROP TABLE IF EXISTS `menus`;
CREATE TABLE `menus` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `created_at` datetime NOT NULL,
  `updated_at` datetime NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态(1:启用 2:不启用)',
  `memo` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `parentID` bigint unsigned NOT NULL COMMENT '父级ID',
  `path` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '菜单URL',
  `component` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '前端组件位置',
  `redirect` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '菜单名称',
  `sequence` bigint NOT NULL COMMENT '排序值',
  `menuType` tinyint(1) NOT NULL COMMENT '菜单类型(1 左侧菜单,2 按钮, 3 非展示权限)',
  `icon` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'icon图标',
  `method` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '操作类型 none/GET/POST/PUT/DELETE',
  `code` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '前端判断权限的code标志',
  `isLink` varchar(256) COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '开启外链条件',
  `isHide` tinyint(1) DEFAULT '0' COMMENT '菜单是否隐藏',
  `isKeepAlive` tinyint(1) DEFAULT '1' COMMENT '菜单是否缓存',
  `isAffix` tinyint DEFAULT '0' COMMENT '菜单是否固定（固定在 tagsView 中，不可进行关闭），右键菜单无 `关闭` 项',
  `isIframe` tinyint(1) DEFAULT '0' COMMENT '是否内嵌,开启条件，`1、isIframe: true 2、链接地址不为空（meta.isLink）`',
  `title` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '标题',
  `group` varchar(255) COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'f分驻',
  `isK8S` tinyint(1) DEFAULT '0' COMMENT 'k8s子路由',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1667235398 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

