-- Records of menus
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for pos_terminal_info
-- ----------------------------
DROP TABLE IF EXISTS `pos_terminal_info`;
CREATE TABLE `pos_terminal_info` (
  `id` varchar(32) NOT NULL COMMENT '终端id',
  `terminal_code` varchar(20) NOT NULL COMMENT '终端编号（1位标识位+4位站点编号），标识位：主POS为1，副POS为2',
  `merchant_id` varchar(32) DEFAULT NULL COMMENT '商户id',
  `terminal_name` varchar(100) DEFAULT NULL COMMENT '终端名称（站点名称+主POS机/副POS机）',
  `terminal_type` char(1) DEFAULT NULL COMMENT '终端类型，1：主POS机，2：副POS机',
  `terminal_ip` varchar(20) DEFAULT NULL COMMENT '终端ip（为授权码用于激活，服务端主动请求终端IP地址）',
  `tcp_port` varchar(10) DEFAULT NULL COMMENT '终端tcp服务监控端口',
  `bos_ip` varchar(20) DEFAULT NULL COMMENT 'POS对应的BOS系统IP地址',
  `download_ip` varchar(20) DEFAULT NULL COMMENT '网关下载IP（文件服务器下载IP，用于下载升级安装包）',
  `trade_ip` varchar(20) DEFAULT NULL COMMENT '网关交易IP（终端交易调用服务地址）',
  `manage_ip` varchar(20) DEFAULT NULL COMMENT '网关管理IP（终端维护类调用服务地址，如激活、日志上传）',
  `upgrade_key` varchar(100) DEFAULT NULL COMMENT '升级密钥',
  `trade_pri_key` varchar(1024) DEFAULT NULL COMMENT '交易密钥',
  `trade_pub_key` varchar(1024) DEFAULT NULL COMMENT '公钥',
  `trade_sign_key` varchar(1024) DEFAULT NULL COMMENT '签名秘钥',
  `manage_key` varchar(1024) DEFAULT NULL COMMENT '管理密钥',
  `status` char(2) NOT NULL COMMENT '状态，00：未激活，01：正常，02：临时关闭，03：长期关闭',
  `initial_time` datetime DEFAULT NULL COMMENT '终端激活时间',
  `version_no` varchar(10) DEFAULT NULL COMMENT '当前版本编号',
  `upgrade_time` datetime DEFAULT NULL COMMENT '当前版本升级时间',
  `terminal_upload_ip` varchar(20) DEFAULT NULL COMMENT '终端ip（终端上传）',
  `terminal_upload_mac_addr` varchar(20) DEFAULT NULL COMMENT '终端mac地址（终端上传）',
  `terminal_upload_os` varchar(50) DEFAULT NULL COMMENT '终端系统（终端上传）',
  `valid_date_beg` datetime DEFAULT NULL COMMENT '有效期开始（预留）',
  `valid_date_end` datetime DEFAULT NULL COMMENT '有效期结束（预留）',
  `pac_node_tree` varchar(64) DEFAULT NULL COMMENT '组织机构树',
  `comment` varchar(255) DEFAULT NULL COMMENT '备注（终端批量停用时需要备注对应信息，批量开启后，清空当前备注）',
  `operator` varchar(50) DEFAULT NULL COMMENT '操作者',
  `insert_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '插入时间',
  `update_time` datetime DEFAULT '2099-12-31 23:59:59' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `Inx_u_1` (`terminal_code`,`merchant_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='终端表';

-- ----------------------------
-- Records of pos_terminal_info
-- ----------------------------
BEGIN;
COMMIT;

